  false,\n\t\"url\": null,\n\t\"notes\": \"The Wah Wah Valley drainage basin is an
  area of about 600 square miles (1,550 km2 ) in Millard and Beaver Counties in southwestern
  Utah. Surface-water supplies of the area are negligible--total runoff averages about
  7,800 acre-feet (9.62 hm3 ) annually, all streams are ephemeral or intermittent,
  and surface storage is negligible. Evaporation and transpiration within the basin
  consume more than 97 percent of total annual precipitation. There is no surface
  outflow.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
